import React, { useState, useEffect } from 'react'
import Edit from './Edit'

export default function Name() {
    const [isSidebarOpen, setIsSidebarOpen] = useState(false)
    const [loggedInUsername, setLoggedInUsername] = useState('')

    const toggleSidebar = () => {
        setIsSidebarOpen(!isSidebarOpen)
    }

    useEffect(() => {
        const fetchUsername = async () => {
            try {
                const response = await fetch(`http://localhost:5000/users/${loggedInUsername}`)
                const userData = await response.json()
                if (userData.username) {
                    setLoggedInUsername(userData.username)
                }
            } catch (error) {
                console.error('Fetch username error:', error)
            }
        }

        fetchUsername()
    }, [loggedInUsername])

    return (
        <div className={`the-container ${isSidebarOpen ? 'disable-the-container' : ''}`}>
            <div className={`edit-sidebar ${isSidebarOpen ? 'open' : ''}`}>
                <Edit onClose={toggleSidebar} />
            </div>
            <div className='name-container'>
                <div className='name'>
                    <div>
                        <div className='username'>{loggedInUsername}</div>
                        <div className='username'>1234567890</div>
                        <div className='username'>dav2005@gmail.com</div>
                    </div>
                </div>
                <div className='edit'>
                    <button className='edit-profile' onClick={toggleSidebar}>
                        EDIT PROFILE
                    </button>
                </div>
            </div>
        </div>
    )
}
